import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { List, ListItem, ListItemIcon, ListItemText, Divider, Icon, Typography} from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: {
        width: '100%',
        maxWidth: 360,
        backgroundColor: theme.palette.background.paper,
    },
}));

function Settings() {

    const classes = useStyles();

    return (
      <div className="container-fluid">
          <div className="row">
            <div className="col-3">
                <Typography>
                    Account Settings
                </Typography>
                <Divider/>
                <List component="nav">
                    <ListItem button>
                        <ListItemIcon>
                            <Icon>inbox</Icon>
                        </ListItemIcon>
                        <ListItemText primary="Change Email" />
                    </ListItem>
                    <ListItem button>
                        <ListItemIcon>
                            <Icon>drafts</Icon>
                        </ListItemIcon>
                        <ListItemText primary="Change Password" />
                    </ListItem>
                    <ListItem button>
                        <ListItemIcon>
                            <Icon>inbox</Icon>
                        </ListItemIcon>
                        <ListItemText primary="Change Avatar" />
                    </ListItem>
                </List>
            </div>
            <div className="col-9">

            </div>
          </div>

      </div>  
    );
}

export default Settings;
